import{v4 as uuid} from "uuid";

const App = ()=> {
  const [todoList,setTodoList]=useState([
    {id: uuid() , name:"name l", age:"2", type:"lion"},
  ]);

  return (
    <Layout>
      <div className='app-main-container'>
      <Form />
      <PictureUP list={todoList}>picture</PictureUP>
      </div>
    </Layout>
  )
}

export default App
